// Importing react  and reactDOM
import React from 'react';
import reactDom from 'react-dom';
// Creating component
const App = () => {
    return <div>Hello world!</div>
}
//  Take the react component and show it to the screen
reactDOM.render(
    <App />,
    document.querySelector('#root')
);
